                'title' => '微信端征途喜结良缘活动 升级送2~35元微信红包 限新用户',
                'body' => '&lt;p&gt;&lt;strong&gt;微信端征途喜结良缘活动 升级送2~35元微信红包 限新用户&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;本次活动仅限新用户参与 新注册用户可抽2~10元微信红包&lt;/p&gt; &lt;p&gt;达到相应的战力可领取相应的微信红包 红包数量有限 先到先得&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;微信端征途喜结良缘活动 升级送2~35元微信红包 限新用户-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/weixin/2016/09/30/bfaaee46b5b3bbb75c27243d9ada9e04.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;达到相应的战力得微信红包&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;微信端征途喜结良缘活动 升级送2~35元微信红包 限新用户-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/weixin/2016/09/30/192cc40c6bce44b8eecaa8450e1647c4.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动规则：&lt;/p&gt; &lt;p&gt;1.活动时间：9月30日 - 10月8日&lt;/p&gt; &lt;p&gt;2.活动期间新注册用户可领取注册礼包一份&lt;/p&gt; &lt;p&gt;3.活动期间新注册用户每日登录即可参与抽奖，达到对应战力值可领取礼包或现金红包&lt;/p&gt; &lt;p&gt;4.道具奖励请在游戏内邮箱中查收，现金红包请在“微信游戏”公众号或“服务通知”中查看并提取&lt;/p&gt; &lt;p&gt;5.现金红包数量有限，先到先得&lt;/p&gt; &lt;p&gt;6.现金红包奖励只针对微信活跃老玩家，长期不活跃的微信号或新建微信小号可能无法获取&lt;/p&gt; &lt;p&gt;7.本活动最终解释权归腾讯公司所有&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动地址：微信扫码  &lt;span style=&quot;color: #ff0000&quot;&gt;如果扫码白色、乱码、提示链接不行，麻烦点右上角分享到朋友圈，再从朋友圈点击进入活动即可&lt;/span&gt;&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;二维码&quot; width=&quot;196&quot; height=&quot;196&quot; data-baiduimageplus-ignore=&quot;&quot; src=&quot;http://pic.iqshw.com/d/file/qita/weixin/2016/09/30/9673b7238761a479341aa2977c708f8b.jpg&quot;&gt;&lt;/p&gt;
