            15 => 
            array (
                'id' => 16,
                'title' => '天翼积分购买理财通领350~2万电信积分 可换Q币与其他会员',
                'body' => '&lt;p&gt;&lt;strong&gt;天翼积分购买理财通领350~2万电信积分 可换Q币与其他会员&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;感谢这位朋友投递 审稿过程中遗忘了 现在才通过说声抱歉&lt;/p&gt; &lt;p&gt;本活动对于电信用户来说还是算好活动的 小编测试了一下大家来看看具体操作吧&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;1：首先我们关注公众号 然后点击赚 赚积分 找到理财通点进去&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;模板.jpg&quot; width=&quot;0&quot; height=&quot;0&quot; src=&quot;http://pic.iqshw.com/d/file/qita/huodong/2016/09/30/9c3970a051450aa3d8aa15f2311177f3.jpg&quot;&gt;&lt;img alt=&quot;天翼积分购买理财通领350~2万电信积分 可换Q币与其他会员-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/huodong/2016/09/30/243f2d57e288607a8f4cab00065a587f.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;2：然后我们看到活动了 点进去购买即可 购买成功之后能获得350~2万天翼积分&lt;/p&gt; &lt;p&gt;天翼积分能干嘛不知道大家都知道吗 不知道的就看下以前发布的活动 &lt;a target=&quot;_blank&quot; href=&quot;http://www.iqshw.com/qqnews/2016/0915/116976.html&quot;&gt;http://www.iqshw.com/qqnews/2016/0915/116976.html&lt;/a&gt;&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;天翼积分购买理财通领350~2万电信积分 可换Q币与其他会员-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/huodong/2016/09/30/6496ffa71362fea6c52ea98869c7efb2.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;3：小编购买的时候是1000国寿 投递者是购买的1元易方达 可能每个人都不一样&lt;/p&gt; &lt;p&gt;然后领取的时候填电信号码 是秒到积分&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;天翼积分购买理财通领350~2万电信积分 可换Q币与其他会员-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/huodong/2016/09/30/1a907732c3dd1a020b0503f322383a36.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;4：小编领了500积分 小编暂时没想好要换什么先留着好了到账截图&lt;/p&gt; &lt;p&gt;对了还有个6元的定期1月理财通 如果谁有闲钱可以选择购买&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;天翼积分购买理财通领350~2万电信积分 可换Q币与其他会员-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/huodong/2016/09/30/fa22377f9d7e43c65f443081106dc9b0.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动地址：微信扫码&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;二维码&quot; width=&quot;193&quot; height=&quot;194&quot; src=&quot;http://pic.iqshw.com/d/file/qita/huodong/2016/09/30/6416b53c61853df727bcafc2be2c40bb.jpg&quot;&gt;    &lt;img alt=&quot;二维码&quot; width=&quot;191&quot; height=&quot;192&quot; src=&quot;http://pic.iqshw.com/d/file/qita/huodong/2016/09/30/5d72870018db10f857e606a6a727e188.jpg&quot;&gt;&lt;/p&gt;
&lt;br&gt;&lt;div class=&quot;time-count-down&quot;&gt; &lt;i class=&quot;ico&quot;&gt;&lt;/i&gt; &lt;b&gt;爱Q生活网提醒您：&lt;/b&gt; &lt;span class=&quot;timecon&quot;&gt;本活动结束时间未知&lt;/span&gt; &lt;/div&gt; &lt;div class=&quot;keyword clearfix&quot;&gt; &lt;div class=&quot;fr bshare&quot;&gt; &lt;div class=&quot;bdsharebuttonbox&quot;&gt; &lt;a href=&quot;#&quot; class=&quot;bds_weixin&quot; data-cmd=&quot;weixin&quot; title=&quot;分享到微信&quot;&gt;&lt;/a&gt; &lt;a href=&quot;#&quot; class=&quot;bds_qzone&quot; data-cmd=&quot;qzone&quot; title=&quot;分享到QQ空间&quot;&gt;&lt;/a&gt; &lt;a href=&quot;#&quot; class=&quot;bds_tsina&quot; data-cmd=&quot;tsina&quot; title=&quot;分享到新浪微博&quot;&gt;&lt;/a&gt; &lt;a href=&quot;#&quot; class=&quot;bds_tieba&quot; data-cmd=&quot;tieba&quot; title=&quot;分享到百度贴吧&quot;&gt;&lt;/a&gt; &lt;a href=&quot;#&quot; class=&quot;bds_sqq&quot; data-cmd=&quot;sqq&quot; title=&quot;分享到QQ好友&quot;&gt;&lt;/a&gt; &lt;script&gt;document.write(\'&lt;a href=&quot;http://qzs.qq.com/snsapp/app/bee/widget/open.htm#content=\' + encodeURIComponent(\'爱Q生活网提醒：\') +\'&amp;url=\' + encodeURIComponent(location.href) + \'&quot; target=&quot;_blank&quot; title=&quot;添加到QQ提醒&quot;&gt;&lt;img src=&quot;http://i.gtimg.cn/snsapp/app/bee/widget/img/3_1.png&quot; width=&quot;50&quot; height=&quot;16&quot; /&gt;\');&lt;/script&gt;
