                'id' => 17,
                'title' => '天猫充值好莱坞会员165元2年 折合6.8元/月 送3600点成长值',
                'body' => '&lt;p&gt;&lt;strong&gt;天猫充值好莱坞会员165元2年 折合6.8元/月 送3600点成长值&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;活动 有2个朋友投递 一个匿名 1个是 @745129166 投递，活动已经实测&lt;/p&gt; &lt;p&gt;而且 是天猫直充放心撸吧 非常划算哦，如果有续费 腾讯视频VIP的朋友 这个真别错过了。&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;天猫充值好莱坞会员165元2年 折合6.8元/月 送3600点成长值-www.iqshw.com&quot; width=&quot;700&quot; height=&quot;434&quot; src=&quot;http://pic.iqshw.com/d/file/qqnews/qzqb/pp/2016/09/30/4a87f2182c401caecfeae35c171effb7.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;投递者实测截图&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;天猫充值好莱坞会员165元2年 折合6.8元/月 送3600点成长值-www.iqshw.com&quot; width=&quot;671&quot; height=&quot;486&quot; src=&quot;http://pic.iqshw.com/d/file/qqnews/qzqb/pp/2016/09/30/104e3636ade5a356102aa396dbac43a5.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;买年费充值截图、&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;天猫充值好莱坞会员165元2年 折合6.8元/月 送3600点成长值-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;575&quot; src=&quot;http://pic.iqshw.com/d/file/qqnews/qzqb/pp/2016/09/30/e6c5d05dc68f47bb527b04b91da98c3b.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;注：小编实测充值只有邮件 跟微信提醒，没有小钱包，不知道是不是个例，当然了这都不是事&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;这个续费 亲测  买1年 送1年 得3600点成长值 （每年1800）&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;165买1年送1年（到账2年）购买地址 &lt;a target=&quot;_blank&quot; href=&quot;http://s.click.taobao.com/KIkvFSx&quot;&gt;http://s.click.taobao.com/KIkvFSx&lt;/a&gt;  吱口令 ￥AAMEjCrD￥&lt;/p&gt; &lt;p&gt;88买半年送半年（到账1年）购买地址 &lt;a target=&quot;_blank&quot; href=&quot;http://s.click.taobao.com/itOvFSx&quot;&gt;http://s.click.taobao.com/itOvFSx&lt;/a&gt;  吱口令   ￥AAMEjkVO￥&lt;/p&gt; &lt;p&gt;注：买1年送1年额外送3600成长值，买半年送半年额外有1800成长值、&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;相关活动 &lt;/p&gt; &lt;p&gt;68/年 好莱坞会员  &lt;a target=&quot;_blank&quot; href=&quot;http://www.iqshw.com/qqnews/2016/0902/116393.html&quot;&gt;http://www.iqshw.com/qqnews/2016/0902/116393.html&lt;/a&gt;&lt;/p&gt;
