            18 => 
            array (
                'id' => 19,
                'title' => '使命召唤超级会员迎国庆 新老用户抽1~3个月超级会员 还有Q币',
                'body' => '&lt;p&gt;&lt;strong&gt;使命召唤超级会员迎国庆 新老用户抽1~3个月超级会员 还有Q币&lt;/strong&gt;&lt;/p&gt; &lt;p&gt; 活动期间 新注册用户在注册当天杀敌10人可概率获得10Q币 还有机会获得1个月-1年的超级会员&lt;/p&gt; &lt;p&gt;所有玩家都能召唤在2016.4.1之后未登录过游戏的战士 召唤1位成功可获得1个月超级会员 召唤成功10位可获得3个月超级会员&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;使命召唤超级会员迎国庆 新老用户抽1~3个月超级会员 还有Q币-www.iqshw.com&quot; width=&quot;700&quot; height=&quot;280&quot; src=&quot;http://pic.iqshw.com/d/file/qqnews/qzqb/pp/2016/09/30/40f1c838e08b26190c80c20fd747f6ad.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;新注册用户当天杀敌10人有机会获得10Q币 还有可能获得1~12个月的超级会员&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;使命召唤超级会员迎国庆 新老用户抽1~3个月超级会员 还有Q币-www.iqshw.com&quot; width=&quot;700&quot; height=&quot;277&quot; src=&quot;http://pic.iqshw.com/d/file/qqnews/qzqb/pp/2016/09/30/2d449212d7190daed6a8e423170cc8ec.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;召唤4.1之后未登录过游戏的玩家  可获得相应的超级会员奖励&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;使命召唤超级会员迎国庆 新老用户抽1~3个月超级会员 还有Q币-www.iqshw.com&quot; width=&quot;700&quot; height=&quot;341&quot; src=&quot;http://pic.iqshw.com/d/file/qqnews/qzqb/pp/2016/09/30/1046269f33c53ae381d58f5e0749a2cb.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动地址：&lt;a target=&quot;_blank&quot; href=&quot;http://codol.qq.com/cp/a20160913vip/index.html&quot;&gt;http://codol.qq.com/cp/a20160913vip/index.html&lt;/a&gt;&lt;/p&gt;
