                'title' => '腾讯理财通新老用户均可领0.66~188元现金红包 可买1元易方达',
            'body' => '&lt;p&gt;&lt;strong&gt;腾讯理财通新老用户均可领0.66~188元现金红包 可买1元易方达&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;感&lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;fa2a41ba9b&quot;&gt;[email protected]&lt;/a&gt;&lt;script data-cfhash=&quot;f9e31&quot; type=&quot;text/javascript&quot;&gt;/* &lt;![CDATA[ */!function(t,e,r,n,c,a,p){try{t=document.currentScript||function(){for(t=document.getElementsByTagName(\'script\'),e=t.length;e--;)if(t[e].getAttribute(\'data-cfhash\'))return t[e]}();if(t&amp;&amp;(c=t.previousSibling)){p=t.parentNode;if(a=c.getAttribute(\'data-cfemail\')){for(e=\'\',r=\'0x\'+a.substr(0,2)|0,n=2;a.length-n;n+=2)e+=\'%\'+(\'0\'+(\'0x\'+a.substr(n,2)^r).toString(16)).slice(-2);p.replaceChild(document.createTextNode(decodeURIComponent(e)),c)}p.removeChild(t)}}catch(u){}}()/* ]]&gt; */&lt;/script&gt;\'ゞゞ ゞ ゞ  忆天 的投递 这个红包说是新用户专享但是老用户也可以领取&lt;/p&gt; &lt;p&gt;只需要买1元即可 大家都参加吧 最高可以领取188元 小编测试的时候是买0.66元&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;腾讯理财通新老用户均可领0.66~188元现金红包 可买1元易方达-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/rmb/2016/09/30/6a7dd1df7820388829f9bf5662f55834.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;直接买入1元即可&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;腾讯理财通新老用户均可领0.66~188元现金红包 可买1元易方达-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/rmb/2016/09/30/ad61692ab428aebde28aa8819cefa3bb.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;直接今天就可以到账 有朋友领到了4元红包 也是买1块钱&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;腾讯理财通新老用户均可领0.66~188元现金红包 可买1元易方达-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/rmb/2016/09/30/d6d87b32fcb373422017aac12e14528b.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;希望大家有好运领到多点的红包哈 毕竟1元购买理财通的机会不多&lt;/p&gt; &lt;p&gt;&lt;span style=&quot;color: #0000ff&quot;&gt;小编标题为了好看才写1元 0.01不太好写 如果实在1元都没有 可以买入0.01元&lt;/span&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;h1&gt;提醒：同一身份不同金额不同QQ可以撸不反撸&lt;/h1&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动地址：QQ扫码&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;二维码&quot; width=&quot;190&quot; height=&quot;191&quot; src=&quot;http://pic.iqshw.com/d/file/qita/rmb/2016/09/30/09e81ef31f40948320ee6792e1a4b7e6.jpg&quot;&gt;&lt;/p&gt;
