                'id' => 23,
                'title' => '福建联通沃趣之旅寻宝奇缘 掷骰子赢话费 流量 IPhone7等奖励',
                'body' => '&lt;p&gt;&lt;strong&gt;福建联通沃趣之旅寻宝奇缘 掷骰子赢话费 流量 IPhone7等奖励&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;活动仅限福建联通用户参与 每位用户每天有3次掷骰子机会 机会用完之后&lt;/p&gt; &lt;p&gt;将页面分享给好友 请好友帮你摇 要到奖励之后登记号码 &lt;span style=&quot;color: #ff0000&quot;&gt;话费将在15个工作日内到账&lt;/span&gt;&lt;/p&gt; &lt;p&gt;流量需要下载流量V网APP 将流量转到手机使用 小编没有福建联通号码 就没有兑换奖励的截图&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;关注公众号  点击菜单栏【沃优惠】--【寻宝IPhone7！】进入活动页面 掷骰子即可&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;福建联通沃趣之旅寻宝奇缘 掷骰子赢话费 流量 IPhone7等奖励-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/hfll/2016/09/30/3d2ad54b5cbe4e7c52ccd4c4fbe2211d.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;获得的奖励可在我的战绩中查看并领奖   &lt;span style=&quot;color: #ff0000&quot;&gt;5元话费好像是摇先订购流量才会送&lt;/span&gt; 朋友们自测&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;福建联通沃趣之旅寻宝奇缘 掷骰子赢话费 流量 IPhone7等奖励-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/hfll/2016/09/30/af88f269716dbb1fc49a5b22b50732be.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动规则：&lt;/p&gt; &lt;p&gt;1、走到终点即为本轮结束，可再开始新一轮的游戏。（ps：当接近终点时，若点数超出会倒退，如已走到第29格，又掷出了5，则会倒退至第28格）&lt;/p&gt; &lt;p&gt;2、您每天有3次掷骰子的机会，机会用完后可邀请好友帮忙掷骰子，活动期间每个好友可帮您摇1次骰子。您也可以通过完成任务获得额外的机会，猛击查看补体秘技，每天还可以再多4次机会哦。&lt;/p&gt; &lt;p&gt;3、奖品设置&lt;/p&gt; &lt;p&gt;        我们在您游戏前进的路上不仅设置了“多玩一次”的好运奖励和“退回终点”的天坑惩罚，还放入了10万份以上的丰富奖品等您领取！&lt;/p&gt; &lt;p&gt;特别大奖：人气7，iPhone7！&lt;/p&gt; &lt;p&gt;        游戏格子随机奖励：2元福建联通话费、5元福建联通话费、100M流量V网流量、200M流量V网流量、500M流量V网流量、14元饿了么代金券、500元携程网旅游大礼包、160元神州专车券、100元福建联通网厅合约机代金券、20元福建联通网厅无限流量卡代金券&lt;/p&gt; &lt;p&gt;        跑得快终点奖励：活动期间，每日第1名到达终点的玩家将获得188元话费奖励，每日第2-10名到达终点的玩家将获得88元话费奖励，每日第11-100名到达终点的玩家将获得5元话费奖励 &lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动地址：微信扫码&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;二维码&quot; width=&quot;190&quot; height=&quot;196&quot; data-baiduimageplus-ignore=&quot;&quot; src=&quot;http://pic.iqshw.com/d/file/qita/hfll/2016/09/30/531db986c806f8658c97ca702644fe39.jpg&quot;&gt;&lt;/p&gt;
