                'title' => '当乐下载战斗吧我的勇士 试玩20分钟得2~5元微信红 数量有限',
                'body' => '&lt;p&gt;&lt;strong&gt;当乐下载战斗吧我的勇士 试玩20分钟得2~5元微信红 数量有限&lt;/strong&gt;&lt;/p&gt; &lt;p&gt; 在当乐APP中下载 魔兽再临：战斗吧！我的勇士 &lt;/p&gt; &lt;p&gt;在9月30日  10:00开服后试玩20分钟以上的前1000名玩家  可领取2~5元微信红包&lt;/p&gt; &lt;p&gt;顺便提一下 在当乐下载异次元战姬  在10.11日开服后试玩20分钟以上的前4000名玩家可领取3元微信红包&lt;/p&gt; &lt;p&gt;到时候会重新置顶的 只是看到这个活动  就顺便提一下&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;h1&gt;战斗吧 我的勇士今天10:00开服  可能会提前开服 朋友们自己关注下&lt;/h1&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;打开当乐APP   点击【发现】--【活动广场】  就可以看到活动入口了&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;当乐下载战斗吧我的勇士 试玩20分钟得2~5元微信红 数量有限-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/weixin/2016/09/29/b4cf28f51e4e480e49d80e703e52d5cb.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;10.11日的异次元战姬的&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;当乐下载战斗吧我的勇士 试玩20分钟得2~5元微信红 数量有限-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;580&quot; src=&quot;http://pic.iqshw.com/d/file/qita/weixin/2016/09/29/9749c5e57f24ce60328ffc9e4cc8c18e.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动参与步骤：&lt;/p&gt; &lt;p&gt;1、在官网 &lt;a target=&quot;_blank&quot; href=&quot;http://app.d.cn&quot;&gt;http://app.d.cn&lt;/a&gt; 或者各大应用市场 下载当乐APP   然后使用微信号登录&lt;/p&gt; &lt;p&gt;2、微信关注【当乐玩家服务】公众号  点击菜单栏【绑定乐号】  绑定当乐账号&lt;/p&gt; &lt;p&gt;3、打开游戏 使用当乐账号登录并试玩15分钟以上（在游戏界面中出现红包已发放即可） 然后就可以在微信中查收微信红包了&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;&lt;span style=&quot;color: #0000ff&quot;&gt;注意：试玩过程中最好不要切换其它应用 不要锁屏！&lt;/span&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动地址：当乐APP&lt;/p&gt;
