                'body' => '&lt;p&gt;&lt;strong&gt;腾讯手游火影忍者国庆7天乐 练级得5~40元微信红包&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;这个估计是 大家最喜欢的练级活动 ，因为难度适中&lt;/p&gt; &lt;p&gt;最近国庆节来了估计类似的活动会很多，而且 是100%的   蹲点即可。&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动截图，除了练级 还可以抽奖&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;腾讯手游火影忍者国庆7天乐 练级得5~40元微信红包-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;576&quot; src=&quot;http://pic.iqshw.com/d/file/qita/weixin/2016/09/29/894dc0345a960b7f252124671c74b764.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;练级奖励&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;腾讯手游火影忍者国庆7天乐 练级得5~40元微信红包-www.iqshw.com&quot; width=&quot;645&quot; height=&quot;576&quot; src=&quot;http://pic.iqshw.com/d/file/qita/weixin/2016/09/29/5d295dc74e32615c7b83d8067fa257cb.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt;活动时间：2016年9月30日—2016年10月7日&lt;br&gt; 活动期间微信玩家每日登录游戏后可参与1次抽奖&lt;br&gt; 升级礼包和忍者收集礼包仅限活动期间内新注册用户参与微信游戏玩家在活动期间内游戏角色达到20级、30级、40级时 ，即可领取对应现金或礼包奖励，&lt;br&gt; 现金总量有限，先到先得；&lt;br&gt; 微信游戏玩家在活动期间内拥有10个或以上忍者，可领取对应现金和礼包奖励，现金总量有限，先到先得；&lt;br&gt; 获得现金的玩家，奖励将以微信红包的形式发放至“微信游戏”公众号或“服务通知”，敬请查收。&lt;/p&gt; &lt;p&gt; &lt;/p&gt; &lt;p&gt;活动地址：微信扫码  （9月30日开启，可先下载游戏）&lt;/p&gt; &lt;p&gt;&lt;img alt=&quot;腾讯手游火影忍者国庆7天乐 练级得5~40元微信红包-www.iqshw.com&quot; width=&quot;197&quot; height=&quot;206&quot; src=&quot;http://pic.iqshw.com/d/file/qita/weixin/2016/09/29/b9179bff23c132d1e2e14f195d07e936.jpg&quot;&gt;&lt;/p&gt; &lt;p&gt;注：如果扫码后白色或乱码，麻烦分享链接到好友或者自己朋友圈，再从朋友微信或者自己朋友圈点进去即可。&lt;/p&gt;
